import React, { Component } from 'react';

class EditUser extends Component {
    constructor(props) {
        super(props);
        const id = this.props.match.params.id;
    }
    
    render() {
        return (
            <div>
                <h2>Page EditUser</h2>
                <p>ID: {id}</p>
            </div>
        );
    }
}

export default EditUser;
